            this.richTextBox24.Text = "    冲量(impulse)。\n    在经典力学里，物体所受合外力的冲量等于它的动量的变化，叫做动量定理。\n    和动量是状态量不同，冲量是一个过程量。 \n" +
    "    一个恒力的冲量指的是这个力与其作用时间的乘积。\n    冲量表述了对质点作用一段时间的积累效应的物理量，是改变质点机械运动状态的原因。\n    冲量：I" +
    " = F*ΔT\n    这里\n    F = 力\n    ΔT = 时间变化";
